import React from 'react';

import classes from "./MealItem.module.css"

const MealItem = (props) => {

    const price = `$${props.price.toFixed(2)}`

    return (
        <li className={classes.meal}>
            <div>
                <h3>{props.name}</h3>
                <div>{props.description} className={classes.description}</div>
                <div>{price} className={classes.price}</div>
            </div>
            <div>

            </div>
        </li>
    );
};

export default MealIte;
